Description: =
============================================

iO - puzzle game with elements of action-platformer in which you control a ball that can be increased or decreased in order to increase speed and take difficult places! Use this mechanic to jumpstart and passing levels. Play with the laws of physics, and solve puzzles as quickly as possible get to the exit. You can win a gold medal at all levels?

